# todo they all are the same number in the end so i just need to figure out what that number is
def solution(a):
    smallest = min(a)
    if len(a) > 1:
        while True:
            if smallest == 1:
                break
            highest = 0
            highest_index = 0
            second_highest = 0
            for i, v in enumerate(a):
                if v > highest:
                    second_highest = highest
                    highest = v
                    highest_index = i
                    continue
                if second_highest < v < highest:
                    second_highest = v
            highest_dif = highest - second_highest
            a[highest_index] = highest_dif
            if highest_dif <= smallest:
                if smallest - highest_dif > 0:
                    smallest = highest_dif
                else:
                    smallest = highest_dif
                    break
    print(smallest)
    return smallest * len(a)


